syntax = "proto2";

package MMPro.micromsg;

import "BaseRequest.proto";
import "BBMContactUploadItem.proto";

message ListBBMContactRequest {
	required BaseRequest _BaseRequest = 1;
	required uint32 _Count = 2;
	repeated BBMContactUploadItem _List = 3;
	required uint32 _ContinueFlag = 4;
	required uint32 _ClickSource = 5;
	required uint32 _Opcode = 6;
}
